/*引入Vue*/
import Vue from 'vue'
/*引入App*/
import App from './App.vue'
/*关闭Vue的生产提示*/
Vue.config.productionTip = false
import vuex from 'vuex'
Vue.use(vuex)
/*创建vm*/
const vm=new Vue({
	el:'#app',
	render: h => h(App),
	store:'hello'
})
console.log(vm);
